import React, { useState } from "react";
import axios from "axios";
import "./newProduct.css";

export default function NewProduct() {
  const [productData, setProductData] = useState({
    name: "",
    description: "",
    image: "",
    sizes: [], // Array for sizes
    colors: [], // Array for colors
    price: "",
    stock: "",
  });

  const handleFormSubmit = async (e) => {
    e.preventDefault();

    try {
      // Send a POST request to your API endpoint
      const response = await axios.post("http://localhost:5001/api/product/products", productData);
      
      // Handle success, e.g., redirect, show a success message, etc.
      console.log("Product created successfully:", response.data);

    } catch (error) {
      // Handle error, e.g., show an error message, log the error, etc.
      console.error("Error creating product:", error.message);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;

    // If the input field is for sizes or colors, split the input value by commas to create an array
    if (name === "sizes" || name === "colors") {
      setProductData((prevData) => ({
        ...prevData,
        [name]: value.split(",").map((item) => item.trim()), // Trim to remove leading/trailing spaces
      }));
    } else {
      setProductData((prevData) => ({
        ...prevData,
        [name]: value,
      }));
    }
  };

  return (
    <div className="newProduct">
      <h1 className="addProductTitle">New Product</h1>
      <form className="addProductForm" onSubmit={handleFormSubmit}>
        <div className="addProductItem">
          <label>Name</label>
          <input
            type="text"
            placeholder="Product Name"
            name="name"
            value={productData.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Description</label>
          <textarea
            placeholder="Product Description"
            name="description"
            value={productData.description}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Image URL</label>
          <input
            type="text"
            placeholder="Image URL"
            name="image"
            value={productData.image}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Sizes</label>
          <input
            type="text"
            placeholder="Size1, Size2, Size3"
            name="sizes"
            value={productData.sizes.join(", ")} // Join array elements with commas for display
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Colors</label>
          <input
            type="text"
            placeholder="Color1, Color2, Color3"
            name="colors"
            value={productData.colors.join(", ")} // Join array elements with commas for display
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Stock</label>
          <input
            type="number"
            placeholder="Stock"
            name="stock"
            value={productData.stock}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="addProductItem">
          <label>Price</label>
          <input
            type="number"
            placeholder="Price"
            name="price"
            value={productData.price}
            onChange={handleInputChange}
            required
          />
        </div>

        <button className="addProductButton" type="submit">
          Create
        </button>
      </form>
    </div>
  );
}
